import React from "react";
import "./About.css"; // Import CSS for styling

const About = () => {
  return (
    <section className="about-section">
      <div className="about-content">
        <h2>About Me</h2>
        <p>
          I'm a passionate Frontend Developer with a strong interest in creating 
          interactive and visually appealing web applications.
        </p>
        <a 
          href="https://www.linkedin.com/in/sumasarakadam" // Replace with your LinkedIn profile
          target="_blank"
          rel="noopener noreferrer"
          className="learn-more-btn"
        >
          Learn More
        </a>
      </div>
    </section>
  );
};

export default About;
